CREATE TABLE `personality_questions` (
  `id` int NOT NULL AUTO_INCREMENT,
  `question` text COLLATE utf8mb4_general_ci NOT NULL,
  `trait` enum('Openness','Conscientiousness','Extraversion','Agreeableness','Neuroticism') COLLATE utf8mb4_general_ci NOT NULL,
  `region` enum('east','north','northeast','south','west') COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
