INSERT INTO `personality_questions` VALUES (1,'I enjoy reading local literature, like Tagore or Odia poetry.','Openness','east'),(2,'I like experimenting with art, dance, or music forms from my state.','Openness','east'),(3,'I enjoy celebrating festivals like Durga Puja or Bihu in different ways.','Openness','east'),(4,'I am interested in traditional crafts like handloom or folk art.','Openness','east'),(5,'I like trying fusion cuisine that mixes local and modern elements.','Openness','east'),(6,'I help prepare for Durga Puja or Bihu well in advance.','Conscientiousness','east'),(7,'I take care of responsibilities even during cultural events.','Conscientiousness','east'),(8,'I stay consistent in my studies or work.','Conscientiousness','east'),(9,'I like making lists and staying organized.','Conscientiousness','east'),(10,'I don\'t delay work even if there\'s a family gathering.','Conscientiousness','east'),(11,'I get excited to meet people during community pujas or melas.','Extraversion','east'),(12,'I enjoy talking with others in local markets or tea shops.','Extraversion','east'),(13,'I participate actively in folk dance or music programs.','Extraversion','east'),(14,'I love family reunions and social events.','Extraversion','east'),(15,'I like being part of organizing school or college functions.','Extraversion','east'),(16,'I help neighbors during events like Durga Puja or community feasts.','Agreeableness','east'),(17,'I believe in being polite and respectful to everyone.','Agreeableness','east'),(18,'I take care of family and friends when they need me.','Agreeableness','east'),(19,'I avoid arguments and try to understand other points of view.','Agreeableness','east'),(20,'I try to forgive people who have hurt me.','Agreeableness','east'),(21,'I feel emotionally affected by what relatives say about my decisions.','Neuroticism','east'),(22,'I worry a lot when results or feedback are delayed.','Neuroticism','east'),(23,'I feel anxious when others compare me to my peers.','Neuroticism','east'),(24,'I often feel stressed before major festivals or exams.','Neuroticism','east'),(25,'I get upset easily if plans change suddenly.','Neuroticism','east'),(26,'I enjoy exploring different states during holidays, like Himachal or Uttarakhand.','Openness','north'),(27,'I am curious about traditional dances like Bhangra or Kathak.','Openness','north'),(28,'I enjoy watching historical Indian movies or epic TV serials.','Openness','north'),(29,'I like tasting regional dishes like chole bhature or rajma chawal.','Openness','north'),(30,'I\'m open to discussing different religious or cultural perspectives.','Openness','north'),(31,'I make sure everything is arranged before a big wedding or function.','Conscientiousness','north'),(32,'I plan well for festivals like Diwali or Holi.','Conscientiousness','north'),(33,'I take pride in maintaining cleanliness at home during festivals.','Conscientiousness','north'),(34,'I help manage community events or religious gatherings.','Conscientiousness','north'),(35,'I finish my tasks before relaxing with family.','Conscientiousness','north'),(36,'I enjoy chatting with people at weddings or community langars.','Extraversion','north'),(37,'I like being involved in group celebrations and dancing.','Extraversion','north'),(38,'I start conversations easily at local tea stalls or parks.','Extraversion','north'),(39,'I enjoy attending large family functions.','Extraversion','north'),(40,'I feel energized after spending time with relatives and neighbors.','Extraversion','north'),(41,'I always touch elders\' feet and follow cultural respect.','Agreeableness','north'),(42,'I try to resolve conflicts peacefully within the family.','Agreeableness','north'),(43,'I help neighbors without expecting anything in return.','Agreeableness','north'),(44,'I believe in maintaining good relations with extended family.','Agreeableness','north'),(45,'I show empathy when others are in distress.','Agreeableness','north'),(46,'I feel anxious during board exams or when elders are upset.','Neuroticism','north'),(47,'I get stressed when guests arrive unexpectedly.','Neuroticism','north'),(48,'I feel overwhelmed during big social functions.','Neuroticism','north'),(49,'I worry about fulfilling family expectations.','Neuroticism','north'),(50,'I feel nervous about how society views my actions.','Neuroticism','north'),(51,'I appreciate traditional tribal art, fashion, or musical forms.','Openness','northeast'),(52,'I enjoy exploring nature and trekking in the hills.','Openness','northeast'),(53,'I like learning about other tribes or regional communities.','Openness','northeast'),(54,'I\'m open to blending tradition with modern lifestyle.','Openness','northeast'),(55,'I enjoy attending and organizing local cultural festivals.','Openness','northeast'),(56,'I stay organized while balancing church, school, or village events.','Conscientiousness','northeast'),(57,'I help in community work like cleaning drives or meetings.','Conscientiousness','northeast'),(58,'I value punctuality and reliability in my work.','Conscientiousness','northeast'),(59,'I make sure I prepare well before any group event or performance.','Conscientiousness','northeast'),(60,'I stay focused even when friends are relaxing.','Conscientiousness','northeast'),(61,'I look forward to festivals like Hornbill or Yaoshang with friends.','Extraversion','northeast'),(62,'I enjoy playing sports or attending youth meets.','Extraversion','northeast'),(63,'I feel comfortable making new friends at social events.','Extraversion','northeast'),(64,'I like helping plan community celebrations or church functions.','Extraversion','northeast'),(65,'I enjoy dancing and singing with others at festivals.','Extraversion','northeast'),(66,'I believe in community welfare and support village decisions.','Agreeableness','northeast'),(67,'I respect elders and leaders in my community.','Agreeableness','northeast'),(68,'I help out during emergencies without hesitation.','Agreeableness','northeast'),(69,'I try to be fair and kind to everyone I meet.','Agreeableness','northeast'),(70,'I value unity and cooperation in my society.','Agreeableness','northeast'),(71,'I feel emotionally sensitive about community or tribal opinions.','Neuroticism','northeast'),(72,'I get nervous when I\'m the center of attention.','Neuroticism','northeast'),(73,'I feel anxious when separated from family during hard times.','Neuroticism','northeast'),(74,'I often worry about not being good enough.','Neuroticism','northeast'),(75,'I feel stressed when traditions or values are challenged.','Neuroticism','northeast'),(76,'I like learning classical forms like Bharatanatyam or Carnatic music.','Openness','south'),(77,'I enjoy watching movies in different South Indian languages.','Openness','south'),(78,'I appreciate visiting heritage temples and ancient sites.','Openness','south'),(79,'I like trying regional dishes like dosa, appam, or Hyderabadi biryani.','Openness','south'),(80,'I\'m open to understanding different customs within South India.','Openness','south'),(81,'I stick to my study/work schedule even during temple festivals.','Conscientiousness','south'),(82,'I plan temple visits or pujas in advance.','Conscientiousness','south'),(83,'I take pride in my punctuality and discipline.','Conscientiousness','south'),(84,'I ensure responsibilities at home are managed before leisure.','Conscientiousness','south'),(85,'I stay committed to long-term personal or career goals.','Conscientiousness','south'),(86,'I love group temple visits or social gatherings in the locality.','Extraversion','south'),(87,'I participate actively in cultural programs or celebrations.','Extraversion','south'),(88,'I enjoy talking with neighbors and shopkeepers.','Extraversion','south'),(89,'I feel energized when I\'m with family or friends during festivals.','Extraversion','south'),(90,'I initiate conversations in buses or local trains.','Extraversion','south'),(91,'I believe in serving guests with full hospitality, like at home temples.','Agreeableness','south'),(92,'I respect the advice of elders in family matters.','Agreeableness','south'),(93,'I try to help people even when I\'m busy.','Agreeableness','south'),(94,'I avoid conflict and try to keep peace in the house.','Agreeableness','south'),(95,'I support friends and family during difficult times.','Agreeableness','south'),(96,'I overthink if I disappoint my family or community elders.','Neuroticism','south'),(97,'I feel anxious when I fall behind on responsibilities.','Neuroticism','south'),(98,'I get nervous before important family or religious events.','Neuroticism','south'),(99,'I worry about maintaining my reputation in society.','Neuroticism','south'),(100,'I often feel overwhelmed when expectations are high.','Neuroticism','south'),(101,'I\'m curious about regional festivals like Ganesh Chaturthi or Navratri.','Openness','west'),(102,'I enjoy learning about ancient forts and local history.','Openness','west'),(103,'I try different types of cuisine, from Maharashtrian to Rajasthani.','Openness','west'),(104,'I\'m open to participating in both modern and traditional events.','Openness','west'),(105,'I like watching regional cinema and folk dramas.','Openness','west'),(106,'I manage time well during busy Navratri or Diwali preparations.','Conscientiousness','west'),(107,'I make sure my home is decorated and clean for festivals.','Conscientiousness','west'),(108,'I maintain a balance between work and family time.','Conscientiousness','west'),(109,'I keep my commitments even during social functions.','Conscientiousness','west'),(110,'I like to plan finances and track expenses carefully.','Conscientiousness','west'),(111,'I love dancing garba or dandiya with large groups.','Extraversion','west'),(112,'I enjoy being around people during society gatherings or events.','Extraversion','west'),(113,'I like starting conversations in local trains or during festivals.','Extraversion','west'),(114,'I feel energetic when involved in planning or organizing events.','Extraversion','west'),(115,'I enjoy being with people in crowded places like markets or fairs.','Extraversion','west'),(116,'I am cooperative during building or society-level events.','Agreeableness','west'),(117,'I show care to elders and respect their advice.','Agreeableness','west'),(118,'I believe in being generous and helpful to those in need.','Agreeableness','west'),(119,'I try to bring people together when there\'s conflict.','Agreeableness','west'),(120,'I am loyal and dependable in friendships.','Agreeableness','west'),(121,'I get easily stressed when there are too many guests or events.','Neuroticism','west'),(122,'I feel anxious when I can\'t meet my own high standards.','Neuroticism','west'),(123,'I overthink about financial security and future plans.','Neuroticism','west'),(124,'I get irritated when things don\'t go as planned.','Neuroticism','west'),(125,'I often worry about making mistakes in public.','Neuroticism','west');
